import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { environment } from '../pages/environments/environment';
import { Factura } from '../pages/domain/factura';

@Injectable({
  providedIn: 'root'
})
export class FacturaService {

  constructor(private http: HttpClient) { }

  getFacturas(){
    let url = environment.WS_PATH + "/facturas/list/"
    return this.http.get<any>(url)
  }

  getAllDetalles() {
    let url = environment.WS_PATH + "/detalles/list/"
    return this.http.get<any>(url)
  }

  saveFacturas(factura: Factura, detallesSeleccionados: Detalle[] = [];){
    let url = environment.WS_PATH + "/facturas/"
    return this.http.post<any>(url, factura)
  }
}
